import { takeLastest, call, put, all } from 'redux-saga/effects';

import api from '~/services/api';

export function signIn({ payload }) {
    const { email, password } = payload;
}

export default all([takeLastest('@auth/SIGN_IN_REQUEST', signIn)]);
